CREATE TABLE Breakdown_Breakdown_Monitoring_Pembayaran_Rutin(
    ID int NOT NULL
   ,MONITORING_PEMBAYARAN_RUTIN_ID int
   ,Jadwal_Pembayaran VARCHAR(255)
   ,Status_Pembayaran VARCHAR(255)
   ,Nilai_Tagihan VARCHAR(255)
   ,Ceklis_Dokumen VARCHAR(255)
   ,Status_Syarat_Pembayaran VARCHAR(255)
   ,Keterangan_Jika_Terlambat VARCHAR(255)
   ,CONSTRAINT pk_Breakdown_Monitoring_Pembayaran_Rutin PRIMARY KEY (ID));


-- Step 2: Create the sequence
CREATE SEQUENCE Breakdown_Monitoring_Pembayaran_Rutin_seq
    START WITH 1
    INCREMENT BY 1
    NOCACHE
    NOCYCLE;

-- Step 3: Create the trigger
CREATE OR REPLACE TRIGGER Breakdown_Monitoring_Pembayaran_Rutin_bir
BEFORE INSERT ON Breakdown_Monitoring_Pembayaran_Rutin
FOR EACH ROW
BEGIN
    SELECT Breakdown_Monitoring_Pembayaran_Rutin_seq.NEXTVAL INTO :NEW.ID FROM dual;
END;


